import React from "react";
import "../styles/Contact.css";

function Contact() {
  const contactCards = [
    {
      name: "GitHub",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/github/github-original.svg",
      link: "https://github.com/talha-xml",
    },
    {
      name: "LinkedIn",
      logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/linkedin/linkedin-original.svg",
      link: "https://www.linkedin.com/in/talha-faizan-46158532a/",
    },
  ];

  return (
    <div className="contact-page">
      {/* Heading OUTSIDE the container */}
      <h1 className="contact-heading">Contact Me ðŸ“¥</h1>

      <div className="contact-container">
        {/* Email displayed separately */}
        <p className="contact-email">
          <strong>Email: </strong>
          <a
            href="mailto:yourname@example.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            yourname@example.com
          </a>
        </p>

        {/* Small guide text */}
        <p className="contact-guide">
          ðŸ‘‰ Click on the names below to visit my profiles:
        </p>

        {/* GitHub & LinkedIn cards */}
        <div className="contact-grid">
          {contactCards.map((item, index) => (
            <div key={index} className="contact-card">
              <img
                src={item.logo}
                alt={`${item.name} logo`}
                className="contact-logo"
              />
              <a
                href={item.link}
                target="_blank"
                rel="noopener noreferrer"
                className="contact-link"
              >
                {item.name}
              </a>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Contact;
